// LoginPage.js
import React from 'react';
import { useAuth } from './AuthContext';

const LoginPage = () => {
    const { login } = useAuth();

    const handleLogin = () => {
        login();
    };

    return (
        <div>
            <div className="container">
                <h2>Login Page</h2>



                <button onClick={handleLogin}>Login</button>
            </div>

        </div>

    );
};

export default LoginPage;
